import { Switch } from "react-router-dom";
import { PublicRoute, PrivateRoute } from "./types";

import BeforeLoginLayout from "../layout/BeforeLogin";
import AfterLoginLayout from "../layout/AfterLogin";

// import Loader from "../components/loader";

export default function Routes() {
    const isLoggedIn = !!localStorage.getItem("token");
    return (
        <>
            <Switch>
                <PublicRoute component={BeforeLoginLayout} path='/login' exact isUserLoggedIn={isLoggedIn} />
                <PrivateRoute component={AfterLoginLayout} path='/' isUserLoggedIn={isLoggedIn} />
            </Switch>
            {/* <Loader /> */}
        </>
    )
}
